import { CardGrid } from '../styles/Cards';

import React from 'react'

function Card() {
    return (
        <CardGrid>
            {cards.map((card) => (
                <div className='card' key={card.id}>
                    <div>
                        <img src={card.src} alt="card back" className="front" />
                        <img src="/img/cover.png" alt="card back" className="back" />
                    </div>
                </div>
            ))}
        </CardGrid>
    )
}

export default Card
